import React from "react";
import "./CradUi.css";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "./CardUi2.css";

const CardUi = (props) => {
  let metadata = props.metadata;
  return (
    // <div className="card-group" >
    <div className="card text-center">
      <div className="overflow">
        <div id="demo" class="carousel slide" data-ride="carousel">
          <ul class="carousel-indicators">
            <li data-target="#demo" data-slide-to="0" class="active"></li>
            <li data-target="#demo" data-slide-to="1"></li>
            <li data-target="#demo" data-slide-to="2"></li>
          </ul>
          <div class="carousel-inner">
          <Carousel
        className="coursel"
        autoPlay
        infiniteLoop
        showThumbs={false}
        stopOnHover
        transitionTime="500"
        interval="3000"
        responsive
      >
        <div>
          <img alt="" src={metadata.imgurl1} />
          <span className="card_description">{metadata.name}</span>
        </div>
        <div>
          <img alt="" src={metadata.imgurl2} />
          <h4 className="card_description">{metadata.name}</h4>
        </div>
        <div>
          <img alt="" src={metadata.imgurl3} />
          <h4 className="card_description">{metadata.name}</h4>
        </div>
      </Carousel>
          </div>
        </div>
      </div>
      <div className="card-body text-dark">
        <h4 className="card-title">{metadata.name} </h4>
        <p className="card-text text-secondary">{metadata.description}</p>
      </div>
    </div>
    // </div>
  );
};

export default CardUi;
